export const styleSheet = () => ({
  root: {
    marginBottom: "25px",
    borderRadius: "12px",
    "& fieldset": {
      border: "2px solid #E6E8EC",
    },
    "& input": {
      padding: "14.5 14px",
    },
  },
  inputLabel: {
    marginLeft: "5px",
    top: "-8px",
    color: "#B1B5C3",
    textTransform: "uppercase",
    fontSize: "12px",
    fontWeight: "600",
    position: "relative",
  },
  inputIcon: {
    color: "green",
  },
});
